import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Header from "../components/Header";
import Footer from "../components/Footer";

export default function Dashboard() {
  const navigate = useNavigate();
  const [reservations, setReservations] = useState([]);
  const [abonnements, setAbonnements] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
      return;
    }

    fetch("http://localhost:8001/api/reservations", {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((res) => {
        if (res.status === 401) {
          localStorage.removeItem("token");
          navigate("/login");
          return null;
        }
        return res.json();
      })
      .then((data) => {
        if (data) {
          setReservations(data.reservations || data || []);
        }
      })
      .catch((err) => {
        setError("Erreur lors du chargement");
      });

    fetch("http://localhost:8001/api/abonnements", {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((res) => {
        if (res.status === 401) {
          return null;
        }
        return res.json();
      })
      .then((data) => {
        if (data) {
          setAbonnements(data.abonnements || data || []);
        }
        setLoading(false);
      })
      .catch((err) => {
        setLoading(false);
      });
  }, [navigate]);

  const handleEnterParking = (reservationId) => {
    const token = localStorage.getItem("token");
    fetch(`http://localhost:8001/api/reservations/${reservationId}/enter`, {
      method: "POST",
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
      },
    })
      .then((res) => res.json())
      .then((data) => {
        alert("Entré dans le parking");
        window.location.reload();
      })
      .catch((err) => {
        alert("Erreur");
      });
  };

  const handleExitParking = (reservationId) => {
    const token = localStorage.getItem("token");
    fetch(`http://localhost:8001/api/reservations/${reservationId}/exit`, {
      method: "POST",
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
      },
    })
      .then((res) => res.json())
      .then((data) => {
        alert("Sorti du parking");
        window.location.reload();
      })
      .catch((err) => {
        alert("Erreur");
      });
  };

  return (
    <div className="min-h-screen flex flex-col">
      <Header />
      <main className="flex-1 container mx-auto px-4 py-8">
        <h1 className="text-2xl font-bold mb-6">Mon tableau de bord</h1>

        {error && <p className="text-red-600 mb-4">{error}</p>}

        <section className="mb-8">
          <h2 className="text-xl font-bold mb-4">Réservations</h2>
          {loading ? (
            <p>Chargement...</p>
          ) : reservations.length === 0 ? (
            <p>Aucune réservation</p>
          ) : (
            <div className="space-y-2">
              {reservations.map((reservation) => (
                <div key={reservation.id} className="border p-4 rounded">
                  <p className="font-bold">{reservation.parking_nom || "Parking"}</p>
                  <p className="text-sm text-gray-600">
                    {reservation.date_debut && reservation.date_fin
                      ? `${new Date(reservation.date_debut).toLocaleDateString()} - ${new Date(reservation.date_fin).toLocaleDateString()}`
                      : "Date non spécifiée"}
                  </p>
                  <p className="text-sm">Statut: {reservation.statut || "En attente"}</p>
                  {reservation.statut === "confirmée" && (
                    <div className="mt-2 space-x-2">
                      <button
                        onClick={() => handleEnterParking(reservation.id)}
                        className="bg-[#34A853] text-white px-3 py-1 rounded text-sm"
                      >
                        Entrer
                      </button>
                      <button
                        onClick={() => handleExitParking(reservation.id)}
                        className="bg-gray-600 text-white px-3 py-1 rounded text-sm"
                      >
                        Sortir
                      </button>
                    </div>
                  )}
                </div>
              ))}
            </div>
          )}
        </section>

        <section>
          <h2 className="text-xl font-bold mb-4">Abonnements</h2>
          {loading ? (
            <p>Chargement...</p>
          ) : abonnements.length === 0 ? (
            <p>Aucun abonnement</p>
          ) : (
            <div className="space-y-2">
              {abonnements.map((abonnement) => (
                <div key={abonnement.id} className="border p-4 rounded">
                  <p className="font-bold">{abonnement.parking_nom || "Parking"}</p>
                  <p className="text-sm">Abonnement mensuel</p>
                  <p className="text-sm">Prix: {abonnement.prix_mensuel || "N/A"} €/mois</p>
                </div>
              ))}
            </div>
          )}
        </section>
      </main>
      <Footer />
    </div>
  );
}
